#include<bits/stdc++.h>
using namespace std;
#define ll long long

bool isSubsequence(string s, string t) {
        if(t.size()>s.size())return false;  
        int j = 0 ;
        for(int i= 0 ;i<s.size();i++)
        {
            
            if(s[i] == t[j])
            {
                cout<<t[j]<<endl;
                j++;
            }
            if(j>=t.size())break;
        }
        if(j > t.size()-1)return true;
        else return false;
    }
int main()
{
    string s = "ahbgdc";
    string t = "abc";
    cout<<isSubsequence(s,t);

}